    xhr.setRequestHeader("Access-Control-Allow-Origin", "*");

    var text = {"command":"PUSH"};
    xhr.send(text);
  } */

  render() {
    return (
      <div className="App">
        <button onClick={() => this.callAPI()}>Click me pls</button>
        <p>{this.state.apiResponse}</p>
      </div>
    );
  }
}

export default App;
